ett\",\"Allison Langdon\",\"Ellen Fanning\",\"Ray Martin\",\"Jana Wendt\",\"Jeff McMullen\",\"Jennifer Byrne\",\"Mike Munro\",\"Richard Carleton\",\"Tracey Curro\",\"Peter Harvey\",\"George Negus\",\"Ian Leslie\",\"Gerald Stone\",\"Sarah Abo\",\"Canada\",\"canada teen killers\",\"canada manhunt\",\"Lucas Fowler\",\"Chynna Deese\",\"Royal Canadian Mounted Police\",\"Bryer Schmegelsky\",\"Kam Mcleod\"],\"channelId\":\"UC0L1suV8pVgO4pCAIBNGx5w\",\"isOwnerViewing\":false,\"shortDescription\":\"For thousands of Australians every year Canada is a wonderful place to visit. It’s not only spectacular but also one of the friendliest and safest countries on earth. However, four weeks ago something awful happened there. A young Australian tourist, Lucas Fowler, and his American girlfriend, Chynna Deese, were murdered. Days later a Canadian university professor was also killed. The attacks were random, unprovoked acts of violence, but the Royal Canadian Mounted Police quickly linked the crimes. Disturbingly it seems the perpetrators were two teenage boys who then went on the run, becoming Canada’s most wanted fugitives. On Thursday they were finally found, dead. For the last two weeks Sarah Abo has been the only reporter to spend time with the distressed father of one of the boys. Abo and her team were with Alan Schmegelsky as heavily armed police and soldiers scoured Canada looking for his 18-year-old son, Bryer. She also spoke with him in the moments after he found out Bryer was dead. In an extraordinary series of interviews Mr Schmegelsky tries to explain the circumstances that may have led his child down a path of evil.\\n\\nWATCH more of 60 Minutes Australia: https:\/\/www.60minutes.com.au \\nLIKE 60 Minutes Australia on Facebook: https:\/\/www.facebook.com\/60Minutes9 \\nFOLLOW 60 Minutes Australia on Twitter: https:\/\/twitter.com\/60Mins \\nFOLLOW 60 Minutes Australia on Instagram: https:\/\/www.instagram.com\/60minutes9\\nLink to related article: https:\/\/www.9news.com uageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0,"contribute":{"captionsMetadataRenderer":{"addSubtitlesText":{"runs":[{"text":"Add subtitles/CC","navigationEndpoint":{"clickTrackingParams":"CAAQu2kiEwjJr4zQz5zqAhUHKvEFHbRzBxE=","commandMetadata":{"webCommandMetadata":{"url":"/timedtext_video?ref=watch\u0026v=9h69UHbRrfY","rootVe":83769}},"urlEndpoint":{"url":"/timedtext_video?ref=watch\u0026v=9h69UHbRrfY"}}}]},"noSubtitlesText":{"simpleText":"This video doesn't have subtitles or closed captions yet."},"promoSubtitlesText":{"simpleText":"Help this video reach more people by contributing subtitles or closed captions in a language you speak."}}}}},"videoDetails":{"videoId":"9h69UHbRrfY","title":"EXCLUSIVE: Disturbing insight on Canada's teen killers | 60 Minutes Australia","lengthSeconds":"1060","keywords":["60 Minutes","60 Minutes Australia","Liz Hayes","Charles Wooley","Tara Brown","Liam Bartlett","Allison Langdon","Ellen Fanning","Ray Martin","Jana Wendt","Jeff McMullen","Jennifer Byrne","Mike Munro","Richard Carleton","Tracey Curro","Peter Harvey","George Negus","Ian Leslie","Gerald Stone","Sarah Abo","Canada","canada teen killers","canada manhunt","Lucas Fowler","Chynna Deese","Royal Canadian Mounted Police","Bryer Schmegelsky","Kam Mcleod"],"channelId":"UC0L1suV8pVgO4pCAIBNGx5w","isOwnerViewing":false,"shortDescription":"For thousands of Australians every year Canada is a wonderful place to visit. It’s not only spectacular but also one of the friendliest and safest countries on earth. However, four weeks ago something awful happened there. A young Australian tourist, Lucas Fowler, and his American girlfriend, Chynna Deese, were murdered. Days later a Canadian university professor was also killed. The attacks were random, unprovoked acts of violence, but the Royal Canadian Mounted Police quickly linked the crimes. Disturbingly it seems the perpetrators were two teenage boys who then went on the run, becoming Canada’s most wanted fugitives. On Thursday they were finally found, dead. For the last two weeks Sarah Abo has been the only reporter to spend time with the distressed father of one of the boys. Abo and her team were with Alan Schmegelsky as heavily armed police and soldiers scoured Canada looking for his 18-year-old son, Bryer. She also spoke with him in the moments after he found out Bryer was dead. In an extraordinary series of interviews Mr Schmegelsky tries to explain the circumstances that may have led his child down a path of evil.\n\nWATCH more of 60 Minutes Australia: https://www.60minutes.com.au \nLIKE 60 Minutes Australia on Facebook: https://www.facebook.com/60Minutes9 \nFOLLOW 60 Minutes Australia on Twitter: https://twitter.com/60Mins \nFOLLOW 60 Minutes Australia on Instagram: https://www.instagram.com/60minutes9\nLink to related article: https://www.9news.com.au/national/canada-murders-60-minuutes-bryer-schmegelsky-kam-mcleod-sarah-abo-news-world/63868e8f-03f1-4ade-b98f-025308dfa6dd\n\nFor forty years, 60 Minutes have been telling Australians the world’s greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, Allison Langdon, Tara Brown, Charles Wooley, Liam Bartlett and Sarah Abo look past the headlines because there is always a bigger picture. Sundays are for 60 Minutes.\n\n#60MinutesAustralia","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/9h69UHbRrfY/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLB64l0k_WAruid9uUzDLISGU3SOyQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/9h69UHbRrfY/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBeWgZSLWZ_Hmec3WZMFaKm089fjw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/9h69UHbRrfY/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj  Australian tourist, Lucas Fowler, and his American girlfriend, Chynna Deese, were murdered. Days later a Canadian university professor was also killed. The attacks were random, unprovoked acts of violence, but the Royal Canadian Mounted Police quickly linked the crimes. Disturbingly it seems the perpetrators were two teenage boys who then went on the run, becoming Canada’s most wanted fugitives. On Thursday they were finally found, dead. For the last two weeks Sarah Abo has been the only reporter to spend time with the distressed father of one of the boys. Abo and her team were with Alan Schmegelsky as heavily armed police and soldiers scoured Canada looking for his 18-year-old son, Bryer. She also spoke with him in the moments after he found out Bryer was dead. In an extraordinary series of interviews Mr Schmegelsky tries to explain the circumstances that may have led his child down a path of evil.\n\nWATCH more of 60 Minutes Australia: https://www.60minutes.com.au \nLIKE 60 Minutes Australia on Facebook: https://www.facebook.com/60Minutes9 \nFOLLOW 60 Minutes Australia on Twitter: https://twitter.com/60Mins \nFOLLOW 60 Minutes Australia on Instagram: https://www.instagram.com/60minutes9\nLink to related article: https://www.9news.com.au/national/canada-murders-60-minuutes-bryer-schmegelsky-kam-mcleod-sarah-abo-news-world/63868e8f-03f1-4ade-b98f-025308dfa6dd\n\nFor forty years, 60 Minutes have been telling Australians the world’s greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, Allison Langdon, Tara Brown, Charles Wooley, Liam Bartlett and Sarah Abo look past the headlines because there is always a bigger picture. Sundays are for 60 Minutes.\n\n#60MinutesAustralia"},"lengthSeconds":"1060","ownerProfileUrl":"http://www.youtube.com/user/60Minutes9","externalChannelId":"UC0L1suV8pVgO4pCAIBNGx5w","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB
